
"""
# Seat Reservation Manager

Design a system that manages the reservation state of `n` seats that are numbered from `1` to `n`.

Implement the `SeatManager` class:
    - `SeatManager(int n)` Initializes a `SeatManager` object that will manage `n` seats numbered from `1` to `n`. All seats are initially available.
    - `int reserve()` Fetches the **smallest-numbered** unreserved seat, reserves it, and returns its number.
    - `void unreserve(int seatNumber)` Unreserves the seat with the given `seatNumber`.


**Example 1:** 
```
Input
["SeatManager", "reserve", "reserve", "unreserve", "reserve", "reserve", "reserve", "reserve", "unreserve"]
[[5], [], [], [2], [], [], [], [], [5]]
Output
[null, 1, 2, null, 2, 3, 4, 5, null]

Explanation
SeatManager seatManager = new SeatManager(5); // Initializes a SeatManager with 5 seats.
seatManager.reserve();    // All seats are available, so return the lowest numbered seat, which is 1.
seatManager.reserve();    // The available seats are [2,3,4,5], so return the lowest of them, which is 2.
seatManager.unreserve(2); // Unreserve seat 2, so now the available seats are [2,3,4,5].
seatManager.reserve();    // The available seats are [2,3,4,5], so return the lowest of them, which is 2.
seatManager.reserve();    // The available seats are [3,4,5], so return the lowest of them, which is 3.
seatManager.reserve();    // The available seats are [4,5], so return the lowest of them, which is 4.
seatManager.reserve();    // The only available seat is seat 5, so return 5.
seatManager.unreserve(5); // Unreserve seat 5, so now the available seats are [5].
```

**Constraints:** 
    - `1 <= n <= 10^5` 
    - `1 <= seatNumber <= n` 
    - For each call to `reserve`, it is guaranteed that there will be at least one unreserved seat.
    - For each call to `unreserve`, it is guaranteed that `seatNumber` will be reserved.
    - At most `10^5` calls **in total** will be made to `reserve` and `unreserve`.
"""

import unittest
import heapq

class SeatManager:
    """
    Since each "reserve" operation always assigns the available seat 
    with the smallest seat number, therefore we can use a min-heap with 
    seat number as key to allow efficient "reserve" operation.

    We may use a (seat_num, length) pair to indicate a sequence of available
    seats, where "seat_num" is seat number of first available seat in the
    sequence, and "length" indicates the length of the sequence.

    For example, if pair (3, 4) is in the heap, it means there are 
    4 consecutive seats available starting from seat number 3.

    Initially, there is only one segment (i.e., (1, n)) as all seats
    are available. Each time we want to reserve a seat, we pop the pair
    with smallest seat number from the heap (e.g., (min_seat_num, length))
    and assign seat number "min_seat_num" to the customer. This can be done
    in O(1) time as min-heap always keeps the smallest element on the root
    node. And then we mark the remaining seats as available by pushing a new
    pair (min_seat_num + 1, length - 1) to the heap (if length > 1).

    For "unreserve" operation, we simply mark the seat as available by
    pushing a length-one segment to the heap (i.e., (seat_num, 1)).

    On average, both "reserve" and "unreserve" take O(log n) time.
    The number of pairs in the heap is at most n.
    """
    def __init__(self, n: int):
        self.heap = [(1, n)]

    def reserve(self) -> int:
        min_seat_num, length = heapq.heappop(self.heap)
        if length > 1:
            heapq.heappush(self.heap, (min_seat_num + 1, length - 1))
        return min_seat_num

    def unreserve(self, seatNumber: int) -> None:
        heapq.heappush(self.heap, (seatNumber, 1))


class Test(unittest.TestCase):
    def testcase1(self):
        ops = ['SeatManager', 'reserve', 'reserve', 'unreserve', 'reserve', 'reserve', 'reserve', 'reserve', 'unreserve']
        args = [[5], [], [], [2], [], [], [], [], [5]]
        answers = [None, 1, 2, None, 2, 3, 4, 5, None]
        self.assertEqual(len(ops), len(args), "Invalid testcase!")
        self.assertEqual(len(args), len(answers), "Invalid testcase!")
        obj = SeatManager(args[0][0])
        for i in range(1, len(ops)):
            operation = getattr(obj, ops[i])
            self.assertEqual(operation(args[i][0]) if args[i] else operation(), answers[i])

